function checkVendor (prop) {
    for (let i = 0; i < vials.length; i++) {
        if (vials[i][prop] === true) {
            vials[i]['vendor'] = prop;
        }
    }
}
// this function looks at the main vials array and if the name of
// the items matches the name of an item in the main array,
// it returns whatever property is asked for in the argument.
function getProperty (name, prop) {
    for (let i = 0; i < vials.length; i++) {
        if (vials[i].name === name) {
            // console.log(vials[i][prop]);
            return vials[i][prop];
        }
    }
}
