function getRelevancy(value, searchTerm) {
    if (value === searchTerm) {
        return 2;
    }
    else if (value.startsWith(searchTerm)) {
        return 1;
    }
    else if (value.includes(searchTerm)) {
        return 0;
    }
}
// these are our event listeners:
search.addEventListener('input', (event) => {
    let value = event.target.value;
    if (value && value.trim().length > 0) {
        value = value.trim().replace(/\s/g, "").toLowerCase();
        const re = new RegExp(value, 'gi');
        setList(vials.filter(i => {
            for (let j = 0; j < i.keywords.length; j++) {
                const element = i.keywords[j];
                // console.log(element)
                if (element.match(re)) {
                    const result = element.match(re);
                    // console.log(result)
                    return result;
                }
                // }).sort((personA, personB) => {
                    //     return getRelevancy(personB.name, value) - getRelevancy(personA.name, value);   
                }
                if (i.name.replace(/\s/g, "").match(re)) {
                    const result1 = i.name.replace(/\s/g, "").match(re);
                    // console.log(result1)
                    return result1;
                }
                if (i.name.match(re)) {
                    const result2 = i.name.match(re);
                    // console.log(result2)
                    return result2;
                }
                // else {
                //     setNoResults();
                //     // clearList();
                // }
                // if (i.name.match(re) || i.name.replace(/\s/g, "").match(re)) {
                //     const result = i.name.match(re) || i.name.replace(/\s/g, "").match(re);
                //     return result;
                // }
    }).sort((a, b) => {
        return getRelevancy(b.name, value) - getRelevancy(a.name, value);
    }));

    } else {
        // setNoResults();
        clearList();
    }
});
